import{_ as t,o as a,c as e,a as n}from"./app-4f7ad5aa.js";const o={},d=n('<h3 id="xtquant-能提供哪些服务" tabindex="-1"><a class="header-anchor" href="#xtquant-能提供哪些服务" aria-hidden="true">#</a> XtQuant 能提供哪些服务</h3><p>XtQuant是基于迅投MiniQMT衍生出来的一套完善的Python策略运行框架，对外以Python库的形式提供策略交易所需要的行情和交易相关的API接口。</p><h3 id="xtquant-运行依赖环境" tabindex="-1"><a class="header-anchor" href="#xtquant-运行依赖环境" aria-hidden="true">#</a> XtQuant 运行依赖环境</h3><p>XtQuant 目前提供的库包括 64 位 Python <code>3.6</code>、<code>3.7</code>、<code>3.8</code>、<code>3.9</code>、<code>3.10</code>、<code>3.11</code>版本，不同版本的 Python 导入时会自动切换。 在运行使用 XtQuant 的程序前需要先启动 MiniQMT 客户端。</p><h3 id="xtquant-运行逻辑" tabindex="-1"><a class="header-anchor" href="#xtquant-运行逻辑" aria-hidden="true">#</a> XtQuant 运行逻辑</h3><p><strong>Xtdata</strong> 作为行情模块，本模块旨在提供精简直接的数据满足量化交易者的数据需求，主要提供行情数据（历史和实时的K线和分笔）、财务数据、合约基础信息、板块和行业分类信息等通用的行情数据。</p><p><strong>Xttrader</strong> 作为交易模块，封装了策略交易所需要的 Python API 接口，可以和 MiniQMT 客户端交互进行报单、撤单、查询资产、查询委托、查询成交、查询持仓以及接收资金、委托、成交和持仓等变动的主推消息。</p>',7),c=[d];function r(h,i){return a(),e("div",null,c)}const u=t(o,[["render",r],["__file","start_now.html.vue"]]);export{u as default};
